import React from "react";
import "./style/mainLogo.css";

import imglogo from "./photo/Logo/logo.svg";
function MainLogo() {
  return (
    <a href="/" className="logo__container vbf-ok">
      <img src={imglogo} alt="" />
    </a>
  );
}

export default MainLogo;
